import React from "react";
import './Card.css';

const Card = (props) => {
    return(
        <div className="bg-light-green dib br4 pad3 ma2 grow bw2 shadow-5">
            <img alt="teste" src="https://robohash.org/test?200x200" />
            <div>
                <h2></h2>
                <p>{props.email}</p>
            </div>     
        </div>
    );
}

export default Card;
